import React, { useState } from "react";
import { Text,View,TextInput,StyleSheet,TouchableOpacity,ScrollView,Picker} from 'react-native';

import { StatusBar } from "expo-status-bar";
import CalendarPicker from 'react-native-calendar-picker';;
import { PaymentIcon } from 'react-native-payment-icons';

const months = [
  { label: "January", value: "01" },
  { label: "February", value: "02" },
  { label: "March", value: "03" },
  { label: "April", value: "04" },
  { label: "May", value: "05" },
  { label: "June", value: "06" },
  { label: "July", value: "07" },
  { label: "August", value: "08" },
  { label: "September", value: "09" },
  { label: "October", value: "10" },
  { label: "November", value: "11" },
  { label: "December", value: "12" }
];


export default function Payment() {
  const [name, setName] = useState('');
  const [cardNumber, setCardNumber] = useState('');
  const [selectedYear, setSelectedYear] = useState('2022');
  const [selectedValue, setSelectedValue] = useState(months[0].value);
  const [cvv, setCvv] = useState(''); 

  
  const onSubmit = () => {
  
  };

    return (
      <ScrollView contentContainerStyle={styles.content}>
      <Text style={styles.title}>Payment details</Text>
 <View style={styles.container}>
  
  <StatusBar style="auto" />

  <View style={styles.inputView}>
      <TextInput
        style={styles.textField}
        placeholder="Cardholder Name"
        value={name}
        onChangeText={(text) =>setName(text)}
      />
      <View style={styles.row}>
      <PaymentIcon type='visa'/>
      <PaymentIcon type='master'  width={40}/>
      <PaymentIcon type='paypal' height='30%'/></View>
       </View>
       <View style={styles.inputView}>
      <TextInput
        style={styles.textField}
        placeholder="Card Number"
        value={cardNumber}
        onChangeText={(text) => setCardNumber(text)}
      />
      </View>
      <View style={styles.row}>
      <View  style={[
            styles.box,
            {
              marginRight: 24,
            },
          ]}>
            <Text style={styles.exp}> Expiration date </Text>
      <Picker
                selectedValue={selectedYear}
                onValueChange={(year) => setSelectedYear(year)}
            >
                <Picker.Item label='2020' value ='2020' />
                <Picker.Item label='2021' value='2021' />
                <Picker.Item label='2022' value='2022' />
                <Picker.Item label='2023' value='2023' />
                <Picker.Item label='2024' value='2024' />
            </Picker>
         </View>
         <View style={styles.box}>

         <Picker
      selectedValue={selectedValue}
      style={{ height: 50, width: 150 }}
      onValueChange={(itemValue, itemIndex) => setSelectedValue(itemValue)}
    >
      {months.map((month) => (
        <Picker.Item key={month.value} label={month.label} value={month.value} />
      ))}
    </Picker>



         </View>
         

      </View>
     
     
      

        <View style={styles.inputView}>
        <TextInput
          style={styles.textField}
          placeholder="Security Code"
          value={cvv}
          onChangeText={(text) => setCvv(text)}
        />
     
      </View>
        <TouchableOpacity
        style={styles.button}
        onPress={onSubmit}
      >
        <Text style={styles.buttonText}>pay</Text>
      </TouchableOpacity>
    </View>
    
    </ScrollView>
    );};

    const styles = StyleSheet.create({
      container: {
        flex: 1,
        backgroundColor: "white",
        alignItems: "center",
        justifyContent: "center",
      },
  row: {
    flex: 1,
    flexDirection: 'row',
   
  },
