    padding: 10,
    marginLeft: 20,
  },
  buttonText: {
    color: '#fff',
    fontWeight: 'bold',
  },
  inputView: {
    backgroundColor: "#F5f5f5",
    borderRadius: 30,
    width: "70%",
    height: 45,
    marginBottom: 20,
    alignItems: "center",
  },
  button: {
    width: "80%",
    borderRadius: 25,
    height: 50,
    alignItems: "center",
    justifyContent: "center",
    marginTop: 40,
    backgroundColor: "#4a1259",
  },
  content: {
    paddingTop: 96,
    paddingHorizontal: 36,
  
  },
  title: {
    fontFamily: 'Avenir-Heavy',
